import React ,{ useState } from "react";
import './App.css';
import {FaDeskpro} from 'react-icons/fa';
function App(){
  const [users,setUsers]=useState([]);
  const load=() =>
  { 
    fetch('https://reqres.in/api/users?page=1')
    .then((response) => response.json())
    .then((json) => {
      console.log(json.data)
      setUsers(json.data); // Prints result from `response.json()` in getRequest
    });
  };
  return (
    <div className="App">
      <header>
        <nav class='navbar'>
        <button onClick={load}>GET DATA</button>
        <span> <FaDeskpro /> ZIGZAG</span>
        </nav>
       </header>
      <div class="box">
      {users.map((data) => {
            return (
              <div className='card'>
                <div className='propic'>
                  <img src={data.avatar} alt='profilepic' class="propic"></img>
                </div>
                <p>
                  {data.first_name} {data.last_name}
                </p>
                <p>{data.email} </p>
              </div>
            );
          })}
      </div>
    </div>
  );
}
export default App;
